import Navbar from "components/Navbar";

const Gallery = () => {
  return (
    <>
      <style jsx global>{`
        body {
          background-image: url("/indexmatty.jpg");
          background-position: center -200px;
          background-attachment: fixed;
        }
      `}</style>
      <img src="/matty4.jpeg" width="400" height="560" />
      <img src="/matty2.jpeg" width="250" height="355" />
      <img src="/matty1.jpeg" width="540" height="350" />
      <img src="/matty3.jpeg" width="800" height="520" />
    </>
  );
};

export default Gallery;
